import React from "react";

const AboutLastSection = () => {
  return (
    <section className="about-last-section">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="about-last-section-wrapper">
              <h2>
                <span>Come reimagine with us</span>
              </h2>
              <div>
                <a href="/" className="readmoreBtn">
                  <span>Search open roles</span>
                </a>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default AboutLastSection;
